import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import LoginPage from "./pages/LoginPage";
import ProfilePage from "./pages/ProfilePage";
import RegisterPage from "./pages/RegisterPage";
import CreatePost from "./pages/CreatePost";
import AllpostPage from "./pages/AllpostPage";
import SinglePostPage from "./pages/SinglePostPage";
import { useState } from "react";

function App() {
  const defaultUsers = [
    {
      picture:
        "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg",
      email: "hello@hello.lt",
      pass1: "qwerty",
      pass2: "qwerty",
    },
    {
      picture:
        "https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg",
      email: "bye@bye.lt",
      pass1: "qwer",
      pass2: "qwer",
    },
  ];
  const [getUser, setUser] = useState(defaultUsers);
  const [selectedPost, setSelectedPost] = useState(null);
  const [logedinUser, setlogedinUser] = useState(true);
  const [posts, setPosts] = useState([
    {
      id: 222,
      title: "TestTitle",
      image:
        "https://www.diocesecpa.org/blog/wp-content/uploads/2019/07/Focus.jpg",
      location: "Vilnius",
    },
    {
      id: 111,
      title: "TestTitle",
      image:
        "https://www.diocesecpa.org/blog/wp-content/uploads/2019/07/Focus.jpg",
      location: "Vilnius",
    },
  ]);

  return (
    <div className="App">
      <div>
        <BrowserRouter>
          <Header logedinUser={logedinUser} setlogedinUser={setlogedinUser} />
          <div className="grow3">
            <Routes>
              <Route
                path="/"
                element={
                  <LoginPage
                    getUser={getUser}
                    logedinUser={logedinUser}
                    setlogedinUser={setlogedinUser}
                  />
                }
              />

              <Route
                path="/register"
                element={
                  <RegisterPage
                    getUser={getUser}
                    setUser={setUser}
                    setlogedinUser={setlogedinUser}
                  />
                }
              />
              <Route
                path="/profile"
                element={
                  <ProfilePage
                    logedinUser={logedinUser}
                    setlogedinUser={setlogedinUser}
                  />
                }
              />

              <Route
                path="/create"
                element={<CreatePost posts={posts} setPosts={setPosts} />}
              />
              <Route
                path="/allpost"
                element={
                  <AllpostPage
                    posts={posts}
                    logedinUser={logedinUser}
                    setSelectedPost={setSelectedPost}
                  />
                }
              />
              <Route
                path="/singlepost/:id"
                element={
                  <SinglePostPage
                    posts={posts}
                    logedinUser={logedinUser}
                    selectedPost={selectedPost}
                  />
                }
              />
            </Routes>
          </div>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
